import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const Partnership = () => {
  const navigate = useNavigate();
  const [showLocationDropdown, setShowLocationDropdown] = useState(false);
  const [showTypeDropdown, setShowTypeDropdown] = useState(false);
  const [showGoalInput, setShowGoalInput] = useState(false);
  const [location, setLocation] = useState({ state: "", city: "" });
  const [orgType, setOrgType] = useState("");
  const [goal, setGoal] = useState("");

  return (
    <div className="min-h-screen relative">
      {/* ÂçäÈÄèÊòéËÉåÊôØÂõæ */}
      <div
        className="absolute inset-0 z-0"
        style={{
          backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.3), rgba(0, 0, 0, 0.3)), url(${heroBg})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          filter: "brightness(0.9)",
        }}
      />

      {/* ËøîÂõûÊåâÈíÆ */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 z-20 text-white hover:text-gray-200 flex items-center gap-2"
      >
        <svg
          className="w-6 h-6"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
        <span>Back</span>
      </button>

      {/* ‰∏ªË¶ÅÂÜÖÂÆπ */}
      <div className="relative z-10 pt-32 px-4 sm:px-6 lg:px-8">
        <div className="max-w-5xl mx-auto text-center">
          <h1 className="text-5xl font-bold text-white mb-8">
            Let's Find Your Perfect Partner
          </h1>

          {/* ÊêúÁ¥¢Ê°ÜÂÆπÂô® */}
          <div className="bg-white rounded-lg shadow-xl p-6 mt-8">
            <div className="flex flex-wrap gap-4 items-center">
              {/* Location ÊåâÈíÆÂíå‰∏ãÊãâÊ°Ü */}
              <div className="relative">
                <button
                  onClick={() => {
                    setShowLocationDropdown(!showLocationDropdown);
                    setShowTypeDropdown(false);
                    setShowGoalInput(false);
                  }}
                  className="flex items-center gap-2 px-4 py-2 bg-gray-50 rounded-lg hover:bg-gray-100"
                >
                  <svg
                    className="w-5 h-5 text-teal-500"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z"
                    />
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M15 11a3 3 0 11-6 0 3 3 0 016 0z"
                    />
                  </svg>
                  <span className="text-gray-700">Location</span>
                </button>

                {showLocationDropdown && (
                  <div className="absolute top-full left-0 mt-2 w-72 bg-white rounded-lg shadow-lg p-4 z-50">
                    <input
                      type="text"
                      placeholder="State"
                      className="w-full mb-2 p-2 border rounded"
                      value={location.state}
                      onChange={(e) =>
                        setLocation({ ...location, state: e.target.value })
                      }
                    />
                    <input
                      type="text"
                      placeholder="City"
                      className="w-full p-2 border rounded"
                      value={location.city}
                      onChange={(e) =>
                        setLocation({ ...location, city: e.target.value })
                      }
                    />
                  </div>
                )}
              </div>

              {/* Organization Type ÊåâÈíÆÂíå‰∏ãÊãâÊ°Ü */}
              <div className="relative">
                <button
                  onClick={() => {
                    setShowTypeDropdown(!showTypeDropdown);
                    setShowLocationDropdown(false);
                    setShowGoalInput(false);
                  }}
                  className="flex items-center gap-2 px-4 py-2 bg-gray-50 rounded-lg hover:bg-gray-100"
                >
                  <svg
                    className="w-5 h-5 text-teal-500"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4"
                    />
                  </svg>
                  <span className="text-gray-700">Organization Type</span>
                </button>

                {showTypeDropdown && (
                  <div className="absolute top-full left-0 mt-2 w-72 bg-white rounded-lg shadow-lg p-4 z-50">
                    <button
                      onClick={() => setOrgType("nonprofit")}
                      className={`w-full p-3 mb-2 rounded-lg text-left ${
                        orgType === "nonprofit"
                          ? "bg-teal-500 text-white"
                          : "bg-gray-50 hover:bg-gray-100"
                      }`}
                    >
                      üåç Nonprofit
                    </button>
                    <button
                      onClick={() => setOrgType("forprofit")}
                      className={`w-full p-3 rounded-lg text-left ${
                        orgType === "forprofit"
                          ? "bg-teal-500 text-white"
                          : "bg-gray-50 hover:bg-gray-100"
                      }`}
                    >
                      üíº For-Profit
                    </button>
                  </div>
                )}
              </div>

              {/* Partnership Goal ÊåâÈíÆÂíåËæìÂÖ•Ê°Ü */}
              <div className="relative flex-grow">
                <button
                  onClick={() => {
                    setShowGoalInput(!showGoalInput);
                    setShowLocationDropdown(false);
                    setShowTypeDropdown(false);
                  }}
                  className="flex items-center gap-2 px-4 py-2 bg-gray-50 rounded-lg hover:bg-gray-100"
                >
                  <svg
                    className="w-5 h-5 text-teal-500"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z"
                    />
                  </svg>
                  <span className="text-gray-700">Partnership Goal</span>
                </button>

                {showGoalInput && (
                  <div className="absolute top-full left-0 mt-2 w-full bg-white rounded-lg shadow-lg p-4 z-50">
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      What Kind of Organization Are You Looking For?
                    </label>
                    <textarea
                      className="w-full p-2 border rounded-lg"
                      rows="4"
                      value={goal}
                      onChange={(e) => setGoal(e.target.value)}
                      placeholder="Describe your ideal partnership..."
                    />
                  </div>
                )}
              </div>

              {/* Search ÊåâÈíÆ */}
              <button className="px-8 py-2 bg-teal-500 text-white rounded-lg hover:bg-teal-600 transition-colors">
                Search
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
